Hidden Camera Detector is an app that helps detect suspicious hidden security cameras in places around you, e.g. hotel rooms, apartments, changing rooms and more. It is designed to protect the privacy and ensure the security of a user’s personal space.

Key features:
• WiFi scanner of devices connected to the local network;
• Bluetooth detector of devices nearby;
• Detection of camera lenses or red dots with the use of filters;
• Logging of search results;
• User-friendly and easy-to-use interface.

We also added the tips for manual detection of hidden electronic devices.  They are located in the “Guide” section of the app.

Take care of yourself and keep your life private!

